    false,nt"url": null,nt"notes": "A review of Parker River NWR's waterfowl
    management program was conducted during April 4-6, 1989. Ongoing and planned waterfowl
    management activities were evaluated by a team led by George Gavutis, Regional Biologist.
    Team members from the Fish and Wildlife Service included Migratory Bird Coordinator,
    George Haas and Zone Biologist, Gerry Atwell. Two wildlife biologists from Delaware's
    Division of Fish and Wildlife also participated;  they were: William Meredith and
    Chester Stachecki. In addition, Assistant Regional Director Don Young, Associate
    Manager Don Frickie, and Assistant Associate Manager Mark Sweeney assisted. Parker
    River NWR ' s objectives are intended to assist in accomplishing the broad goals,
    objectives, and long-range plans of the National Wildlife Refuge System and the
